<html lang="en" class="no-js">
  <head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width,initial-scale=1.0">
    <style>
            * { margin: 0; padding: 0; }
            html, body {
                height: 100%;
                width: 100%;
                overflow: hidden;
                font-family: Arial, sans-serif;
                background-color: #fff;
            }
            .screenshot {
                width: 100%;
                display: block;
                margin-bottom: 20px;
            }
            .cookie-banner {
                position: fixed;
                top: 50%;
                left: 50%;
                transform: translate(-50%, -50%);
                width: 80%;
                max-width: 500px;
                background-color: rgba(255, 255, 255, 0.95);
                color: #000;
                text-align: center;
                padding: 15px;
                border-radius: 10px;
                box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.2);
                z-index: 9999;
            }

            .cookie-banner button {
                background-color: #007bff;
                border: none;
                color: white;
                padding: 10px 20px;
                text-align: center;
                text-decoration: none;
                display: inline-block;
                font-size: 16px;
                margin: 10px;
                cursor: pointer;
                border-radius: 5px;
            }
            .cookie-banner a {
                color: #007bff;
                text-decoration: underline;
            }
            @media (max-width: 768px) {
                .screenshot.desktop {
                    display: none;
                }
            }
            @media (min-width: 769px) {
                .screenshot.mobile {
                    display: none;
                }
            }
    </style>
